import React, { Component } from "react";
import { Redirect } from "react-router-dom";
class logout extends Component {
  clearStorage() {
    localStorage.removeItem("token");
  }
  render() {
    return (
      <div>
        {this.clearStorage()}
        <Redirect to="/Login" />
      </div>
    );
  }
}
